import React from "react";
import { useImageData } from "../ImageProvider";

const Projects = () => {
    const { projectData, loading, error } = useImageData();

    const response = projectData.find(project => project.title === "banner")?.images || [];
    const projects = response.slice(1);

    return (
        <div className="w-full h-full flex justify-center items-center text-white">

            {projects.map(project => (
                <div key={project.title} className="w-1/3 h-1/2 bg-white m-4 text-black">
                    <img className="object-cover" src={project.images[0]} alt="project"/>
                </div>
            ))}

        </div>
    );
}

export default Projects;
